import React from 'react'
import './builder.css'

function SidebarRow({Icon, title}) {
    return (
        <div className="sidebarRow">
            {Icon && <Icon />}
            <p className="sidebar__title"> {title} </p>
        </div>
    )
}

export default SidebarRow
